// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/math/Math.sol";

contract TVERTHBPair is ReentrancyGuard {
    using SafeERC20 for IERC20;

    IERC20 public immutable tverToken;
    IERC20 public immutable thbToken;

    uint256 public constant MINIMUM_LIQUIDITY = 10**3;
    uint256 public constant FEE_DENOMINATOR = 10000;
    uint256 public swapFee = 30; // 0.3% fee
    uint256 public accumulatedFees;

    uint256 public reserve0; // TVER reserve
    uint256 public reserve1; // THB reserve
    uint256 public totalSupply;

    mapping(address => uint256) public balanceOf;
    mapping(address => uint256) public tverDeposited;
    mapping(address => uint256) public thbDeposited;

    event Mint(address indexed sender, uint256 amount0, uint256 amount1);
    event Burn(address indexed sender, uint256 amount0, uint256 amount1, address indexed to);
    event Swap(address indexed sender, uint256 amount0In, uint256 amount1In, uint256 amount0Out, uint256 amount1Out, address indexed to);
    event Sync(uint256 reserve0, uint256 reserve1);

    constructor(address _tverToken, address _thbToken) {
        tverToken = IERC20(_tverToken);
        thbToken = IERC20(_thbToken);
    }

    function addLiquidity(uint256 tverAmount, uint256 thbAmount) external nonReentrant returns (uint256 liquidity) {
        (uint256 _reserve0, uint256 _reserve1) = getReserves();
        uint256 balance0 = tverToken.balanceOf(address(this));
        uint256 balance1 = thbToken.balanceOf(address(this));

        require(tverAmount > 0 && thbAmount > 0, "INSUFFICIENT_INPUT_AMOUNT");

        // Transfer tokens from user to the contract
        tverToken.safeTransferFrom(msg.sender, address(this), tverAmount);
        thbToken.safeTransferFrom(msg.sender, address(this), thbAmount);

        uint256 _totalSupply = totalSupply;
        if (_totalSupply == 0) {
            liquidity = Math.sqrt(tverAmount * thbAmount) - MINIMUM_LIQUIDITY;
            _mint(address(0), MINIMUM_LIQUIDITY);
        } else {
            liquidity = Math.min(
                (tverAmount * _totalSupply) / _reserve0,
                (thbAmount * _totalSupply) / _reserve1
            );
        }

        require(liquidity > 0, "INSUFFICIENT_LIQUIDITY_MINTED");
        _mint(msg.sender, liquidity);

        _update(balance0 + tverAmount, balance1 + thbAmount);
        emit Mint(msg.sender, tverAmount, thbAmount);

        tverDeposited[msg.sender] += tverAmount;
        thbDeposited[msg.sender] += thbAmount;
    }

    function removeLiquidity(uint256 liquidity) external nonReentrant returns (uint256 amount0, uint256 amount1) {
        require(liquidity > 0, "INSUFFICIENT_LIQUIDITY_BURNED");
        (uint256 _reserve0, uint256 _reserve1) = getReserves();
        uint256 _totalSupply = totalSupply;

        amount0 = (liquidity * _reserve0) / _totalSupply;
        amount1 = (liquidity * _reserve1) / _totalSupply;
        require(amount0 > 0 && amount1 > 0, "INSUFFICIENT_LIQUIDITY_BURNED");

        _burn(msg.sender, liquidity);
        tverToken.safeTransfer(msg.sender, amount0);
        thbToken.safeTransfer(msg.sender, amount1);

        uint256 balance0 = tverToken.balanceOf(address(this));
        uint256 balance1 = thbToken.balanceOf(address(this));
        _update(balance0, balance1);
        emit Burn(msg.sender, amount0, amount1, msg.sender);

        tverDeposited[msg.sender] -= amount0;
        thbDeposited[msg.sender] -= amount1;
    }

    function swap(uint256 tverAmountIn, uint256 thbAmountIn, uint256 tverAmountOutMin, uint256 thbAmountOutMin, address to) external nonReentrant {
        require(tverAmountIn > 0 || thbAmountIn > 0, "INSUFFICIENT_INPUT_AMOUNT");
        (uint256 _reserve0, uint256 _reserve1) = getReserves();

        // Transfer input tokens from user to the contract
        if (tverAmountIn > 0) {
            tverToken.safeTransferFrom(msg.sender, address(this), tverAmountIn);
        }
        if (thbAmountIn > 0) {
            thbToken.safeTransferFrom(msg.sender, address(this), thbAmountIn);
        }

        uint256 balance0 = tverToken.balanceOf(address(this));
        uint256 balance1 = thbToken.balanceOf(address(this));

        uint256 amount0Out = balance0 > _reserve0 + tverAmountIn ? balance0 - (_reserve0 + tverAmountIn) : 0;
        uint256 amount1Out = balance1 > _reserve1 + thbAmountIn ? balance1 - (_reserve1 + thbAmountIn) : 0;

        require(amount0Out > 0 || amount1Out > 0, "INSUFFICIENT_OUTPUT_AMOUNT");
        require(amount0Out >= tverAmountOutMin && amount1Out >= thbAmountOutMin, "INSUFFICIENT_OUTPUT_AMOUNT");
        require(amount0Out <= _reserve0 && amount1Out <= _reserve1, "INSUFFICIENT_LIQUIDITY");

        uint256 amount0In = balance0 - _reserve0 - amount0Out;
        uint256 amount1In = balance1 - _reserve1 - amount1Out;

        uint256 fee0 = (amount0In * swapFee) / FEE_DENOMINATOR;
        uint256 fee1 = (amount1In * swapFee) / FEE_DENOMINATOR;
        amount0In -= fee0;
        amount1In -= fee1;

        require((amount0In * _reserve1 + amount1In * _reserve0) >= (_reserve0 * _reserve1), "K");

        _update(balance0 - amount0Out, balance1 - amount1Out);
        emit Swap(msg.sender, amount0In, amount1In, amount0Out, amount1Out, to);

        if (amount0Out > 0) tverToken.safeTransfer(to, amount0Out);
        if (amount1Out > 0) thbToken.safeTransfer(to, amount1Out);

        accumulatedFees += fee0 + fee1;
    }

    function getReserves() public view returns (uint256 _reserve0, uint256 _reserve1) {
        _reserve0 = reserve0;
        _reserve1 = reserve1;
    }

    function quote(uint256 amountA, uint256 reserveA, uint256 reserveB) public pure returns (uint256 amountB) {
        require(amountA > 0, "INSUFFICIENT_AMOUNT");
        require(reserveA > 0 && reserveB > 0, "INSUFFICIENT_LIQUIDITY");
        amountB = (amountA * reserveB) / reserveA;
    }

    function _update(uint256 balance0, uint256 balance1) private {
        reserve0 = balance0;
        reserve1 = balance1;
        emit Sync(reserve0, reserve1);
    }

    function _mint(address to, uint256 value) private {
        totalSupply += value;
        balanceOf[to] += value;
    }

    function _burn(address from, uint256 value) private {
        balanceOf[from] -= value;
        totalSupply -= value;
    }
}

